import React from 'react'

const MenuItem = ({item, handleClick}) => {

    const showName = () => {
        console.log('elaba')
    };

    let svg = document.createElement('div');
    svg.innerHTML = item.icon;
    console.log(svg)

    return (
        <div className="menu-item" onClick={handleClick} onMouseOver={showName}>
            {svg}
            <p className="hidden">{item.name}</p>
        </div>
    )
}

export default MenuItem
